		["cast on you (tank only) - airhorn sound active (selfcd)"] = {
			["glow"] = false,
			["text1FontSize"] = 20,
			["disjunctive"] = "all",
			["untrigger"] = {
				["custom"] = "\n\n",
			},
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = -10,
			["customTextUpdate"] = "update",
			["actions"] = {
				["start"] = {
					["sound"] = "Interface\\AddOns\\WeakAuras\\Media\\Sounds\\AirHorn.ogg",
					["do_sound"] = true,
				},
				["init"] = {
					["custom"] = "aura_env.spells = {\n    [254919] = true, --forging strike\n    \n}\n\nfunction aura_env.GetAllUnitIDs(maxDepth)\n    local candidates ={\n        'player',\n        'target',\n        'mouseover',\n        'pet',\n        'npc',\n        'focus',\n        'vehicle',\n        'none', --included for completeness\n    }\n    for i = 1,40 do\n        tinsert(candidates,\"nameplate\"..i)\n        tinsert(candidates,\"raid\"..i)\n        tinsert(candidates,\"raidpet\"..i)\n    end\n    for i = 1,4 do\n        tinsert(candidates,\"party\"..i)\n        tinsert(candidates,\"partypet\"..i)\n        tinsert(candidates,\"arena\"..i)\n        tinsert(candidates,\"boss\"..i)\n    end\n    tinsert(candidates,\"arena5\")\n    tinsert(candidates,\"boss5\")\n    local validUnits = {}\n    --0 will only check primitive\n    maxDepth = type(maxDepth) == \"number\" and maxDepth or 0\n    maxDepth = floor(maxDepth)\n    local iterations = 0\n    while true do\n        --we go backwards because it was easier for me\n        for i = #candidates,1,-1 do\n            local unit, GUID = candidates[i], UnitGUID(candidates[i])\n            --can't just pop the final bit off, since we do insert other bits on\n            tremove(candidates,i)\n            if UnitExists(unit) then\n                --keying by GUID allows us to quickly find duplicates\n                if not validUnits[GUID] or #validUnits[GUID] > #unit then\n                    validUnits[GUID] = unit\n                    --needs to go on the end so as to not corrupt the traversal\n                    tinsert(candidates,unit..'target')\n                end\n            end\n        end\n        iterations = iterations + 1\n        if maxDepth >= 0 and maxDepth < iterations then break end\n        if #candidates == 0 then break end\n    end\n    return validUnits\nend",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
			["text2Font"] = "PT Sans Narrow",
			["keepAspectRatio"] = false,
