			["customText"] = "function()\n    -- Armor calulation\n    -- local level = 113\n    local Armor = select(2, UnitArmor(\"player\")) or 0\n    local armor_dr = Armor / (Armor + aura_env.ArmorConst[aura_env.EHLevel]) or 0 -- calc dr from armour\n    local cap = 0.85 -- armor capped at 85% physical reduction\n    if armor_dr >= cap then armor_dr = cap end\n    Armor = 1 - armor_dr\n    \n    -- All Classes\n    local EHCurrent = UnitHealth(\"player\")\n    local EHMax = UnitHealthMax(\"player\")\n    local Vers = 1 - (GetCombatRatingBonus(31)/100)\n    local Avoid = 1\n    if aura_env.EHAoE == \"yes\" then Avoid = 1 - (GetAvoidance()/100)\n    end\n    local AbsorbsP = UnitGetTotalAbsorbs(\"player\")\n    local AbsorbsM = AbsorbsP\n    \n    -- Initialize some variables\n    local ClassDRP, ClassDRM = 1, 1\n    local EHPImmunity, EHMImmunity = 0, 0\n    \n    -- General damage reduction buffs\n    local n = 1\n    local BuffID = select (11, UnitBuff(\"player\", n))\n    while BuffID do\n        local reduction = aura_env.EHReductions[BuffID] or {1, 1}\n        ClassDRP = ClassDRP*reduction[1]\n        ClassDRM = ClassDRM*reduction[2]\n        n = n + 1\n        BuffID = select (11, UnitBuff(\"player\", n))\n    end\n    \n    -- Damage reductions with special calculations\n    -- Death Knight\n    if aura_env.EHPlayerClass == 6 then\n        local IceF, Necropolis, EHpet, BloodS = 1, 1, 0, 0\n        IceF = 1 + ((tonumber(select(19,UnitBuff(\"player\", GetSpellInfo(48792))) or 0))/100) -- Icebound Fortitude // using plus since the tooltip returns a negative value\n        if IsPlayerSpell(206967) then -- Will of the Necropolis - Talent\n            if (EHCurrent / EHMax) < 0.35 then Necropolis = 0.65\n            end\n        end\n        if aura_env.EHAoE == \"yes\" and aura_env.specID == 3 then\n            local UnholyDK = 1-0.05*aura_env.ArtifactTraits[191584]\n            Avoid = Avoid*UnholyDK -- Unholy Artifact trait\n        end\n        if UnitBuff(\"player\", GetSpellInfo(207319)) then -- Corpse Shield\n            local PetHealth = UnitHealth(\"pet\")\n            if UnitBuff(\"pet\", GetSpellInfo(47484)) or UnitBuff(\"pet\", GetSpellInfo(212384)) -- Huddle and Protective Bile\n            then EHpet = (PetHealth /0.5) else EHpet = PetHealth end\n        end\n        local AMS = select(17,UnitBuff(\"player\", GetSpellInfo(48707))) or 0 -- Anti-Magic Shell\n        AbsorbsP = Absorbs + EHpet - AMS\n        AbsorbsM = Absorbs + EHpet - BloodS\n        ClassDRP = ClassDRP*IceF*Necropolis\n        ClassDRM = ClassDRM*IceF*Necropolis\n    end\n    \n    -- Demon Hunter\n    if aura_env.EHPlayerClass == 12 then\n        local Blur, DHmagic, DemWards, DemonS, FireBrand, PainBringer, LegCloak = 1, 1, 1, 1, 1, 1, 1\n        if IsEquippedItem(137066) and UnitBuff(\"player\", GetSpellInfo(178740)) then LegCloak = 0.85 -- Immolation Aura\n        end\n        if IsPlayerSpell(205411) and UnitBuff(\"player\", GetSpellInfo(198589)) then Blur = 0.50 -- Blur\n        elseif UnitBuff(\"player\", GetSpellInfo(198589)) then Blur = 0.65\n        end\n        if aura_env.specID == 1 then DHmagic = 0.84 -- Artifact trait\n        end\n        if aura_env.specID == 2 then DemWards = 0.80 -- Demonic Wards - Passive\n        end\n        DemonS = 1 + (tonumber(select(18,UnitBuff(\"player\", GetSpellInfo(203720))) or 0))/100 -- Demon Spikes // using plus since the tooltip returns a negative value\n        if select(4, UnitDebuff(\"target\", GetSpellInfo(204021), nil, \"player\")) then FireBrand = 0.60 -- Fiery Brand\n        end\n        PainBringer = 1 - 0.03 * (select(4,UnitBuff(\"player\", GetSpellInfo(212988))) or 0) -- Painbringer\n        if UnitBuff(\"player\", GetSpellInfo(196555)) then EHPImmunity = 1 -- Netherwalk\n        end\n        \n        ClassDRP = ClassDRP*DemonS*DemWards*Blur*FireBrand*PainBringer\n        ClassDRM = ClassDRM*Blur*DHmagic*DemWards*FireBrand*PainBringer*LegCloak\n    end\n    \n    -- Druid\n    if aura_env.EHPlayerClass == 11 then\n        local GuardA, Moonfire, RendandTear, Survival = 1, 1, 1, 1\n        if IsEquippedItem(137015) and IsPlayerSpell(16931) then GuardA = 0.895 elseif IsPlayerSpell(\"16931\") then GuardA = 0.94\n        end\n        if aura_env.specID == 3 then\n            if UnitDebuff(\"target\", GetSpellInfo(164812), nil, \"player\") then\n                Moonfire = 1-0.01*aura_env.ArtifactTraits[238049] -- Scintillating Moonlight\n            end\n            if IsPlayerSpell(204053) then\n                RendandTear = 1 - 0.02 * (select(4, UnitDebuff(\"target\", GetSpellInfo(192090), nil, \"player\")) or 0) -- Rend and Tear\n            end\n            if UnitBuff(\"player\", GetSpellInfo(61336)) then\n                Survival = 0.5- (0.1/3*aura_env.ArtifactTraits[200415]) -- Survival Instincts\n            end\n        else\n            if UnitBuff(\"player\", GetSpellInfo(61336)) then Survival = 0.5 end\n        end\n        \n        ClassDRP = ClassDRP*GuardA*Moonfire*RendandTear*Survival\n        ClassDRM = ClassDRM*GuardA*Moonfire*RendandTear*Survival\n    end\n    \n    -- Hunter\n    if aura_env.EHPlayerClass == 3 then\n        if UnitBuff(\"player\", GetSpellInfo(186265)) then -- Aspect of the Turtle\n            EHPImmunity = 1\n            EHMImmunity = 1\n        end\n        ClassDRP = ClassDRP\n        ClassDRM = ClassDRM\n    end\n    \n    -- Mage\n    if aura_env.EHPlayerClass == 8 then\n        if UnitBuff(\"player\", GetSpellInfo(45438)) then -- Ice block\n            EHPImmunity = 1\n            EHMImmunity = 1\n        end\n        ClassDRP = ClassDRP\n        ClassDRM = ClassDRM\n    end\n    \n    \n    -- Monk\n    if aura_env.EHPlayerClass == 10 then\n        local BreathFire, StaggerP, StaggerM = 1, 1, 1\n        if aura_env.specID == 1 then\n            BreathFire = 1 + 0.01*(select(18, UnitDebuff(\"target\", GetSpellInfo(123725), nil, \"PLAYER\")) or 0) -- Breath of Fire\n            StaggerP = 0.4\n            if IsPlayerSpell(196737) then StaggerP = StaggerP + 0.1 end -- High Tolerance\n            if UnitBuff(\"player\", GetSpellInfo(243435)) then StaggerP = StaggerP + 0.1 end -- Fortifying Brew\n            StaggerP = StaggerP + ((select(17,UnitBuff(\"player\", GetSpellInfo(215479))) or 0) / 100) -- Ironskin Brew\n            if IsPlayerSpell(237076) then StaggerM = 0.56*StaggerP else  StaggerM = 0.4*StaggerP end\n            StaggerP = 1-StaggerP\n            StaggerM = 1-StaggerM\n            \n            --Stagger cap\n            local CurrentStagger = UnitStagger(\"player\") or 0\n            --Calculates max effective reduction for Stagger\n            local StaggerCapP = (EHCurrent + AbsorbsP) / (EHCurrent + AbsorbsP + 10*EHMax - CurrentStagger)\n            local StaggerCapM = (EHCurrent + AbsorbsM) / (EHCurrent + AbsorbsM + 10*EHMax - CurrentStagger)\n            if StaggerCapP < 0.01 then StaggerCapP = 0.01 end --Max Stagger caps at 99%\n            --if StaggerCapM < 0.01 then StaggerCapM = 0.01 end\n            if StaggerP < StaggerCapP then StaggerP = StaggerCapP end\n            if StaggerM < StaggerCapM then StaggerM = StaggerCapM end\n        end\n        ClassDRP = ClassDRP*BreathFire*StaggerP\n        ClassDRM = ClassDRM*BreathFire*StaggerM\n    end\n    \n    -- Paladin\n    local Devotion = 1 + (tonumber(select(17,UnitBuff(\"player\", GetSpellInfo(210320))) or 0))/100 -- Devotion Aura // using plus since the tooltip returns a negative value\n    if UnitBuff(\"player\", GetSpellInfo(1022)) then EHPImmunity = 1 end -- Blessing of Protection\n    if UnitBuff(\"player\", GetSpellInfo(204018)) then EHMImmunity = 1 end -- Blessing of Spellwarding\n    if aura_env.EHPlayerClass == 2 then\n        local EyeTyr, KnightTemp, ShieldR, PalaRing = 1, 1, 1, 1\n        if select(8,UnitDebuff(\"target\", GetSpellInfo(209202))) == \"player\" then EyeTyr = 0.75 -- Eye of Tyr\n        end\n        if IsPlayerSpell(204139) and UnitBuff(\"player\", GetSpellInfo(190784)) then KnightTemp = 0.80 -- Knight Templar and Divine Steed\n        end\n        local ShieldR = 1 + (tonumber(select(17,UnitBuff(\"player\", GetSpellInfo(53600))) or 0))/100 -- Shield of the Righteous // using plus since the tooltip returns a negative value\n        if IsEquippedItem(137047) and UnitBuff(\"player\", GetSpellInfo(26573)) then PalaRing = 0.96 -- Consecration\n        end\n        if UnitBuff(\"player\", GetSpellInfo(642)) then -- Divine Shield\n            EHPImmunity = 1\n            EHMImmunity = 1\n        end\n        ClassDRP = ClassDRP*EyeTyr*KnightTemp*ShieldR*PalaRing\n        ClassDRM = ClassDRM*EyeTyr*KnightTemp*ShieldR*PalaRing\n    end\n    \n    \n    -- Priest\n    if aura_env.EHPlayerClass == 5 then\n        local FocusedW, Perseverance = 1, 1\n        FocusedW = 1 - (select(4,UnitBuff(\"player\", GetSpellInfo(45243))) or 0)*15/100 -- Focused Will\n        if IsPlayerSpell(235189) and UnitBuff(\"player\", GetSpellInfo(139), nil, \"player\") then\n            Perseverance = 0.9 -- Holy Priest talent - Perseverance\n        end\n        ClassDRP = ClassDRP*FocusedW*Perseverance\n        ClassDRM = ClassDRM*FocusedW*Perseverance\n    end\n    \n    \n    -- Rogue\n    local Elusive, CrimsonV = 1, 1\n    if aura_env.EHPlayerClass == 4 then  \n        CrimsonV = 1 + ((tonumber(select(17,UnitBuff(\"player\", GetSpellInfo(240525))) or 0))/100) -- Dense Concoction // using plus since the tooltip returns a negative value\n        if UnitBuff(\"player\", GetSpellInfo(1966)) and aura_env.EHAoE == \"no\" and IsPlayerSpell(\"79008\")\n        then Elusive = 0.70 end -- Elusiveness\n        if UnitBuff(\"player\", GetSpellInfo(1966)) and aura_env.EHAoE == \"yes\" then Avoid = Avoid*0.50 end -- Feint\n        if UnitBuff(\"player\", GetSpellInfo(31224)) then EHMImmunity = 1 end -- Cloak of Shadows\n        ClassDRP = ClassDRP*CrimsonV*Elusive\n        ClassDRM = ClassDRM*CrimsonV*Elusive\n    end\n    \n    \n    -- Shaman\n    if aura_env.EHPlayerClass == 7 then\n        ClassDRP = ClassDRP\n        ClassDRM = ClassDRM\n    end\n    \n    \n    -- Warlock\n    if aura_env.EHPlayerClass == 9 then\n        local SoulLink = 1\n        if aura_env.specID == 2 then -- Soul Link passive for Demonology Warlocks\n            if (EHCurrent / EHMax) * 100 < 35 and UnitExists(\"pet\") then\n                SoulLink = 0.60\n            elseif UnitExists(\"pet\") then\n                SoulLink = 0.80\n            end \n        end\n        ClassDRP = ClassDRP*SoulLink\n        ClassDRM = ClassDRM*SoulLink\n    end\n    \n    \n    -- Warrior\n    if aura_env.EHPlayerClass == 1 then\n        local DemoS, Enrage = 1, 1\n        if select(8,UnitDebuff(\"target\", GetSpellInfo(1160))) == \"player\" then DemoS = 0.80 -- Demoralizing Shout\n        end\n        if UnitBuff(\"Player\", GetSpellInfo(184361)) then -- Enrage\n            if IsPlayerSpell(208154) then Enrage = 1.15\n            else Enrage = 1.2\n            end\n        end\n        \n        ClassDRP = ClassDRP*DemoS*Enrage\n        ClassDRM = ClassDRM*DemoS*Enrage\n    end\n    \n    -- Miscellaneous\n    \n    -- Damage taken modifiers\n    local ReductionP = (1*Vers*Avoid*ClassDRP*Devotion*Armor)\n    local ReductionM = (1*Vers*Avoid*ClassDRM*Devotion)\n    -- Current health and shields, rounds down to nearest 0.1m\n    local EHP = (EHCurrent + AbsorbsP)/ReductionP\n    EHP = aura_env.shortNum(EHP, 6)\n    local EHM = (EHCurrent + AbsorbsM)/ReductionM\n    EHM = aura_env.shortNum(EHM, 6)\n    \n    \n    -- Export pre-avoidance EHP, EHM and immunity status as global variables\n    if aura_env.EHGlobalExport == \"yes\" then\n        -- Calculates max effective health (no absorbs)\n        local EHPMax = aura_env.shortNum(EHMax/ReductionP, 6)\n        local EHMMax = aura_env.shortNum(EHMax/ReductionM, 6)\n        -- export to globals\n        WA_ZELER_EHPMAX, WA_ZELER_EHMMAX = EHPMax*Avoid*Elusive, EHMMax*Avoid*Elusive\n        WA_ZELER_EHP, WA_ZELER_EHM = EHP*Avoid*Elusive, EHM*Avoid*Elusive\n        WA_ZELER_EHPIMMUNITY, WA_ZELER_EHMIMMUNITY = EHPImmunity, EHMImmunity\n        WA_ZELER_EHPARMOR = Armor\n    end\n    \n    -- Formats displayed text with appropriate colors\n    local color = \"\"\n    if aura_env.EHMode ~= \"magic\" then\n        for i = 1, 6 do\n            if EHP >= aura_env.EHThreshold[1][i] then color = aura_env.EHColor[i] end\n        end\n        if EHPImmunity == 1 then color = aura_env.EHColor[7] end\n        EHP = string.format(aura_env.EHPEndText, color, EHP)\n    else EHP = \"\"\n    end\n    \n    if aura_env.EHMode ~= \"physical\" then\n        for i = 1, 6 do\n            if EHM >= aura_env.EHThreshold[2][i] then color = aura_env.EHColor[i] end\n        end\n        if EHMImmunity == 1 then color = aura_env.EHColor[7] end\n        EHM = string.format(aura_env.EHMEndText, color, EHM)\n    else EHM = \"\"\n    end\n    \n    local separator = \"\"\n    if aura_env.EHMode == \"both\" then separator = \" | \" end\n    \n    return EHP..separator..EHM\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
