				["init"] = {
					["custom"] = "-- Made by Zeler-Ravencrest EU, edited by Stryer-Ravencrest EU\naura_env.EHMode = \"both\" -- Choose from \"physical\", \"magic\", \"both\" to change the value(s) displayed\naura_env.EHAoE = \"yes\" -- Enable avoidance with \"yes\" and disable it with \"no\". Remember to keep the \"\" marks\naura_env.EHGlobalExport = \"yes\" -- Enable export of certain variables as global variables for use in other weakauras\naura_env.EHLevel = 113\n\n-- Sets the format of displayed text\naura_env.EHPEndText = \"P:|c%s%.1fm|r\"\naura_env.EHMEndText = \"M:|c%s%.1fm|r\"\n\n-- Color values, the accepted values are from 0 to 255\n-- {red, green, blue}\naura_env.EHColor = {\n    {255, 0, 0},   -- lowest hp\n    {255, 128, 0},\n    {0, 255, 0},\n    {0, 255, 255},\n    {255, 0, 255},\n    {255, 255, 0}, -- highest hp\n    {0, 60, 255},  -- immunity color\n}\n\n--Thresholds at which the color changes (leave the first 0)\naura_env.EHThreshold = {\n    {0, 7, 10, 15, 25, 44},     --Physical EH\n    {0, 5.5, 6.5, 10, 14, 20},  --Magic EH\n}\n\nlocal function RGBtoHex(rgb)\n    return string.format(\"ff%02x%02x%02x\", rgb[1], rgb[2], rgb[3])\nend\n\nfor i = 1, #aura_env.EHColor do\n    aura_env.EHColor[i] = RGBtoHex(aura_env.EHColor[i])\nend\n\n-- Check player class and spec\naura_env.EHPlayerClass = select(3,UnitClass(\"player\"))\naura_env.specID = GetSpecialization()\n\nfunction aura_env.getArtifactTraitRank(traitid)\n    local currentRank = 4 -- defaults rank is 4\n    if IsAddOnLoaded(\"LibArtifactData-1.0\") or LoadAddOn(\"LibArtifactData-1.0\") then\n        aura_env.LAD = aura_env.LAD or LibStub(\"LibArtifactData-1.0\")\n        if not aura_env.LAD:GetActiveArtifactID() then\n            aura_env.LAD:ForceUpdate()\n        end\n        --pos, traitid, spellid, name, icon, rank, max, bonus, gold, first, last\n        for _, _, spellid, name, _, rank in aura_env.LAD:IterateTraits() do\n            if spellid == traitid then\n                currentRank = rank\n                break\n            end\n        end\n    end\n    return currentRank\nend\n\naura_env.ArtifactTraits = {\n    --Unholy DK\n    [191584] = aura_env.getArtifactTraitRank(191584), -- Unholy Endurance\n    --Guardian Druid\n    [238049] = aura_env.getArtifactTraitRank(238049), -- Scintillating Moonlight\n    [200415] = aura_env.getArtifactTraitRank(200415), -- Survival Instincts\n    --Mistweaver\n    [199365] = aura_env.getArtifactTraitRank(199365), -- Shroud of Mist\n    --Marksmanship\n    [190514] = aura_env.getArtifactTraitRank(190514), -- Survival of the Fittest\n    --Holy Pala\n    [200302] = aura_env.getArtifactTraitRank(200302), -- Knight of the Silver Hand\n    --Discipline\n    [197711] = aura_env.getArtifactTraitRank(197711), -- Vestments of Discipline\n    --Resto Shaman\n    [207354] = aura_env.getArtifactTraitRank(207354), -- Caress of the Tidemother\n    [207351] = aura_env.getArtifactTraitRank(207351), -- Ghost in the Mists\n    --Destro Lock\n    [196305] = aura_env.getArtifactTraitRank(196305), -- Eternal Struggle\n}\n\n-- Class self-buffs: [spellid] = {Phys Reduc, Magic Reduc}\naura_env.EHReductions = {\n    --DK\n    [195181] = {0.84, 0.84}, -- Bone Shield\n    [194679] = {0.60, 0.60},  -- Rune Tap\n    --DH\n    [218256] = {1, 0.70}, -- Empower Wards\n    --Druid\n    [80313] = {0.91, 0.91}, -- Pulverize\n    [22812] = {0.80, 0.80}, -- Barkskin\n    [200851] = {0.75, 0.75}, -- Rage of the Sleeper\n    [102342] = {0.72, 0.72}, -- Ironbark\n    --Hunter\n    [186265] = {0.70, 0.70}, -- Aspect of the Turtle\n    [190515] = {1-0.1/3*aura_env.ArtifactTraits[190514], 1-0.1/3*aura_env.ArtifactTraits[190514]}, -- Survival of the Fittest\n    --Mage\n    [113862] = {0.40, 0.40}, -- Greater Invisibility\n    [235450] = {1, 0.85}, -- Prismatic Barrier\n    [235313] = {0.80, 1}, -- Blazing Barrier\n    [214626] = {0.92, 0.92}, -- Jouster\n    --Monk\n    [120954] = {0.80, 0.80}, -- Fortifying Brew (BrM)\n    [243435] = {0.80, 0.80}, -- Fortifying Brew (MW)\n    [122278] = {0.80, 0.80},  -- Dampen Harm, assumed at minimum reduction\n    [122783] = {1, 0.40},  -- Diffuse Magic\n    [214478] = {1-0.1/3*aura_env.ArtifactTraits[199365], 1-0.1/3*aura_env.ArtifactTraits[199365]}, -- Shroud of Mist\n    [115176] = {0.4, 0.4}, -- Zen Meditation\n    --Paladin\n    [498] = {0.80, 0.80},   -- Divine Protection\n    [31850] = {0.80, 0.80}, -- Ardent Defender\n    [205191] = {0.65, 1}, -- Eye for an Eye\n    [86659] = {0.50, 0.50},  -- Guardian of Ancient Kings\n    [183436] = {0.70, 0.70}, -- Retribution\n    [211422] = {1-0.1/3*aura_env.ArtifactTraits[200302], 1-0.1/3*aura_env.ArtifactTraits[200302]}, -- Knight of the Silver Hand\n    [6940] = {0.70, 0.70}, -- Blessing of Sacrifice\n    [204335] = {0.80, 0.80}, -- Aegis of Light\n    --Priest\n    [47585] = {0.40, 0.40}, -- Dispersion\n    [193063] = {0.90, 0.90}, -- Masochism\n    [216135] = {1-0.1/3*aura_env.ArtifactTraits[197711], 1-0.1/3*aura_env.ArtifactTraits[197711]}, -- Vestments of Discipline\n    [232698] = {0.90, 0.90}, -- Shadowform\n    [33206] = {0.60, 0.60}, -- Pain Suppression\n    [194384] = {0.98, 0.98}, -- Atonement (Lenience's Reward)\n    [62618] = {0.75, 0.75}, -- PW: Barrier\n    --Rogue\n    [45182] = {0.15, 0.15},  -- Cheating Death\n    --Shaman\n    [108271] = {0.60, 0.60}, -- Astral Shift\n    [209950] = {1-0.1/3*aura_env.ArtifactTraits[207354], 1-0.1/3*aura_env.ArtifactTraits[207354]}, -- Caress of the Tidemother\n    [207527] = {1-0.1/3*aura_env.ArtifactTraits[207351], 1-0.1/3*aura_env.ArtifactTraits[207351]}, -- Ghost in the Mists\n    [98007] = {0.90, 0.90}, -- Spirit Link Totem\n    --Warlock\n    [104773] = {0.60, 0.60}, -- Unending Resolve\n    [196304] = {1-0.1/3*aura_env.ArtifactTraits[196305], 1-0.1/3*aura_env.ArtifactTraits[196305]}, -- Eternal Struggle\n    --Warrior\n    [197690] = {0.80, 0.80}, -- Defensive Stance\n    [118038] = {0.65, 0.65}, -- Die by the Sword\n    [184364] = {0.70, 0.70}, -- Enraged Regeneration\n    [871] = {0.60, 0.60},     -- Shield Wall\n    [23920] = {1, 0.50},   -- Spell Reflection\n    [223657] = {0.70, 0.70}, -- Safeguard\n    --Misc\n    [241836] = {0.95, 0.95},  -- Shadow of Celumbra\n    [65116] = {0.90, 1}, -- Stoneform\n    [211080] = {0.90, 0.90} -- Comforting light (Court of Stars)\n}\n\n-- Armor\naura_env.ArmorConst = {\n    157,167,177,187,197,\n    207,217,227,237,247,\n    257,267,277,287,297,\n    307,317,327,337,347,\n    357,367,377,387,397,\n    407,417,427,437,447,\n    457,467,477,487,497,\n    507,517,527,537,547,\n    557,567,577,587,597,\n    607,617,627,637,647,\n    657,667,677,687,697,\n    707,717,727,737,747,\n    757,767,777,787,797,\n    807,817,827,837,847,\n    857,867,877,887,897,\n    907,917,927,937,947,\n    957,967,977,987,997,\n    1007,1017,1027,1037,1047,\n    1185,1342,1518,1718,1945,\n    2201,2491,2819,3190,3610,\n    5435,5613,5799,5994,6199,\n    6415,6642,6880,7132,7390,\n    7648,7906,8164\n}\n\n--function to shorten numbers and round down to nearest 0.1\naura_env.shortNum = function(a, b)\n    b = 10^(b-1)\n    return 0.1*(a - a%b)/b    \nend\n\n--print(\"Effective Health Initialization done\")",
